import axios from 'axios';
import React, { useState } from 'react'
import { MdOutlineSort } from "react-icons/md";
import { Link, useLocation } from 'react-router-dom';
import Loader from './Loader';


const History = () => {
  const location = useLocation();
  const [startDate , setstartDate]=useState(null)
  const [endDate , setendDate]=useState(null)
  const [loading , setLoading]=useState(null)
  const [selectedvalue, setselectedvalue] = useState('id');
  const [currentpage, setcurrentpage] = useState(0); // Start from page 1


  const searchCustomers = () => {
    setLoading(true);
    console.log(startDate, endDate)
    axios
        .get(`http://localhost:8080/bill/findBylocalDateBetween/${startDate}/${endDate}`)
        .then((response) => {
            console.log(response)
            // setSearchResults(response.data);
            setLoading(false);
            
        })
        .catch((err) => {
            if (err.response && err.response.status === 404) {
                alert('Data not found');
            } else {
                console.log(err);
            }
        })
        .finally(() => {
            setLoading(false);
        });
};


useEffect(() => {
  getAllCommission();
}, [selectedvalue, currentpage]);

const recordsperpages = 10;

const prepage = () => {

  setcurrentpage(currentpage - 1);

};

const nextpage = () => {
  if (currentpage < offset) {
      setcurrentpage(currentpage + 1);
  }
};

const getAllCommission = () => {
  setLoading(true);
  axios
      .get(`http://localhost:8080/bill/getAllBills/${currentpage}/${recordsperpages}/${selectedvalue}`)
      .then((response) => {
          // console.log(response)
          setCustomer(response.data.data.content);
          setOffset(response.data.data.totalPages);
         
      })
      .catch((error) => {
          console.error(error);
          
      }).
      finally(()=>{
          setLoading(false);
      })
};



const Csvfile_For_Type = (e) => {
  e.preventDefault();
  setLoading(true);
  console.log( startDate,endDate)

  axios
    .get(`http://localhost:8080/bill/csv/${startDate}/${endDate}`)
    .then((response) => {
      // Extract CSV data from the response
      console.log(response)
      const csvData = response.data;


      // Create a Blob containing the CSV data
      const blob = new Blob([csvData], { type: 'text/csv' });

      // Create a download link
      const link = document.createElement('a');
      link.href = URL.createObjectURL(blob);
      link.download = `transaction_${startDate}_${endDate}_data.csv`;
      link.click();

      // Clean up
      URL.revokeObjectURL(link.href);
      console.log(response.data)
    })
    .catch((err) => {
      if (err.response && err.response.status === 404) {
        alert("Data not found");
        console.log(err);
      } else {
        console.log(err);
      }
    })
    .finally(() => {
      setLoading(false); // Set loading to false when request is completed
    });
};

  
  return (
